INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1, 2, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", "カリン", -363.0, 1000005, "2025/01/31 12:00:00", 2.12, 0.0, 5, 1, 190801, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2030/01/01 14:59:59", "カリン", -363.0, 1000006, "2025/01/31 12:00:00", 1.68, 0.0, 6, 1, 190801, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1, 2, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", "カリン", -363.0, 1000007, "2025/01/31 12:00:00", 2.33, 0.0, 7, 1, 190801, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (7, 3, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", "ラビリスタ", -285.0, 1020101, "2025/01/31 12:00:00", 5.18, -6.0, 101, 10201, 133701, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", "クリスティーナ", -285.0, 1020102, "2025/01/31 12:00:00", 8.77, -2.0, 201, 10201, 133901, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1, 6, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", "ネネカ", -285.0, 1020103, "2025/01/31 12:00:00", 15.5, 0.0, 301, 10201, 133801, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (5, 2, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", "ランファ", -285.0, 1020201, "2025/02/28 12:00:00", 9.061, 0.0, 101, 10202, 134301, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", "チカ", -285.0, 1020202, "2025/02/28 12:00:00", 7.699, 0.0, 201, 10202, 134401, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", "アオイ", -285.0, 1020301, "2025/03/31 12:00:00", 8.595, 0.0, 101, 10203, 134601, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", "クローチェ", -285.0, 1020302, "2025/03/31 12:00:00", 7.758, 0.0, 201, 10203, 134501, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (6, 2, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", "ルイズマリー", -285.0, 1020401, "2025/04/30 12:00:00", 7.0, 0.0, 101, 10204, 132302, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", "イロハ", -285.0, 1020402, "2025/04/30 12:00:00", 7.904, 0.0, 201, 10204, 132402, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 4, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", "ソノ", -285.0, 1020403, "2025/04/30 12:00:00", 8.487, 0.0, 301, 10204, 132502, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (2, 1, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2030/01/01 14:59:59", "カノン", -285.0, 1020502, "2025/05/31 12:00:00", 8.763, 0.0, 101, 10205, 134901, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (3, 1, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2030/01/01 14:59:59", "ツムギ", -285.0, 1020503, "2025/05/31 12:00:00", 6.417, 0.0, 201, 10205, 134801, 61);
